// src/App.js
import React from 'react';
import DataTable from './components/DataTable/DataTable';
import FormComponent from './components/Form/Form';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <Container>
      <Row className="mt-5">
        <Col md={8}>
          <DataTable />
        </Col>
        <Col md={4}>
          <FormComponent />
        </Col>
      </Row>
    </Container>
  );
}

export default App;
